	.data
	# displayAddress:	.word 	0x10008000
	displayAddress:	.word	0x10040000	# heap
	displayWidth:	.word	64
	displayHeight:	.word 	128
	
	background:	.space	32768		# 64 * 128 * 4
	backgroundColor:.word	0x0087ceeb	# 135, 206, 235 (sky blue)
		
	doodleWidth:	.word 	8
	doodleHeight:	.word	8
	doodleOutline:	.word	0x00000000	# black
	doodleBody:	.word	0x00da0205	# 218, 02, 05 (red)
	doodleHead: 	.word	0x00e8fd4d	# 232, 253, 77 (yellow)
	doodleCol:	.word	0		# doodle's current column
	doodleRow:	.word	0		# doodle's current row
	airTime:	.word	0		# doodle's current air time (in frames)
		
	platformWidth:	.word	16
	platformHeight:	.word	4
	platformOutline:.word	0x00000000	# black
	platformBody:	.word 	0x00388004	# 56, 128, 4 (green)
	platformPos:	.space	88		# 11 * 2 * 4 spaces reserved for platforms, maximum 11 platforms
	
	gameState:	.word 	-1		# game's current state. -1 = welcome, 0 = in-game, 1 = game over
	hiScore:	.word	0		# high score
	curScore:	.word	0		# current score
	numberColor:	.word 	0x00000000	# black
	
	curSound:	.word	-1		# current sound effect to play
	
	
	.text
main:				# main
	# initialization


welcomeScreen:			# welcome screen
	li $t0, -1		# $t0 = -1
	sw $t0, gameState	# set game state to -1, welcome screen
	jal setBackground	# draw the background
	jal drawBackground	# draw the background
	lw $t0, hiScore		# $t0 = high score
	lw $t1, curScore	# $t1 = current score
	bge $t0, $t1, hiScoreUpdateDone	# if high score >= current score, don't update
	addi $t0, $t1, 0	# else, set $t0 = current score
	sw $t0, hiScore		# save new high score
hiScoreUpdateDone:
	addi $a2, $t0, 0	# $a2 = $t0, current score
	li $a0, 40		# $a0 = 40, column to start drawing
	li $a1, 82		# $a1 = 82, row to start drawing
	jal drawNumber		# draw the high score to the screen
welcomeKeyLoop:
	lw $t0, 0xffff0000		# $t0 = is key being pressed?
	beq $t0, 1, welcomeKeyInput	# branch to intrepret keyboard input if key is pressed
	j welcomeKeyLoop		# otherwise repeat loop

welcomeKeyInput:			
	lw $t0, 0xffff0004		# $t0 = ASCII value of key being pressed
	beq $t0, 0x73, startGame	# if key being pressed is S, start the game
	j welcomeKeyLoop		# otherwise, jump back to welcomeKeyLoop


startGame:			# start the game
	li $t0, 0		# $t0 = 0
	sw $t0, gameState	# set game state to 0, in-game
	jal setBackground	# draw the background
	jal drawBackground	# draw the background
	# set Doodle's original position
	li $t0, 28
	sw $t0, doodleCol
	li $t0, 112
	sw $t0, doodleRow
	li $t0, 0
	sw $t0, airTime
	li $t0, 0
	sw $t0, curScore
	# done setting Doodle's original position
	# restart current sound
	li $t0, -1		# $t0 = -1
	sw $t0, curSound	# set current sound to -1
	# set platforms's positions
	la $t0, platformPos	# $t0 = platform position base address
	li $t1, 24		# $t1 = 24, column of first platform
	sw $t1, 0($t0)		# store column of first platform
	addi $t0, $t0, 4	# #t0 += 4, increment $t0 by 1 word
	li $t2, 113		# $t2 = 113, row of first platform
	sw $t2, 0($t0)		# store row of first platform
	addi $t0, $t0, 4
	li $t3, 10		# $t3 = 10, counts down number of platforms still to draw
setInitialPlatformLoop:		# loop for setting the original position of platforms
	li $v0, 42		# id for random number generator
	li $a0, 0		# id of random number generator = 0
	li $a1, 49		# upper bound of random integer
	syscall			# get random number
	sw $a0, 0($t0)		# save random number as column of platform
	addi $t0, $t0, 4	# $t0 += 4, increment $t0 by 1 word
	addi $t2, $t2, -12	# $t2 += -12, row of platform
	sw $t2, 0($t0)		# save $t2 as row of platform
	addi $t0, $t0, 4	# $t0 += 4, increment $t0 by 1 word
	addi $t3, $t3, -1	# $t3 += -1, decrement counter
	bgtz $t3, setInitialPlatformLoop	# keep looping if counter still greater than 0
	# done setting platform's initial positions
	
	lw $a0, doodleCol
	lw $a1, doodleRow
	jal drawDoodle		# draw Doodle at initial position
	# li $a0, 24
	# li $a0, 48
	# li $a1, 113
	# li $a1, 127
	# jal drawPlatform	# draw the first platform
	# draw the initial platforms
	la $s0, platformPos	# $s0 = platform position base address
	li $s1, 11		# $s1 = 11, counts down number of platforms still to draw
drawInitialPlatformLoop:	# draw the initial position of platforms
	lw $a0, 0($s0)		# $a0 = column of platform
	addi $s0, $s0, 4	# $s0 += 4, increment $s0 by 1 word
	lw $a1, 0($s0)		# $a1 = row of platform
	addi $s0, $s0, 4	# $s0 += 4, increment $s0 by 1 word
	jal drawPlatform	# jump to draw platform
	addi $s1, $s1, -1	# $t2 += -1, decrement counter
	bgtz $s1, drawInitialPlatformLoop	# keep looping if counter still greater than 0
	# done drawing initial platforms
	# li $v0, 32
	# li $a0, 1000
	# syscall			# sleep


gameLoop:			# new frame
	# play background music
	li $a1, 400		# $a1 = 400, play for 400 ms
	lw $t0, curSound	# $t0 = current sound
	beq $t0, 0, playE
	beq $t0, 8, playBshort
	beq $t0, 12, playCshort
	beq $t0, 16, playD
	beq $t0, 24, playCshort
	beq $t0, 28, playBshort
	beq $t0, 32, playA
	beq $t0, 40, playAshort
	beq $t0, 44, playCshort
	beq $t0, 48, playE
	beq $t0, 56, playDshort
	beq $t0, 60, playCshort
	beq $t0, 64, playB
	beq $t0, 72, playBshort
	beq $t0, 76, playCshort
	beq $t0, 80, playD
	beq $t0, 88, playE
	beq $t0, 96, playC
	beq $t0, 104, playA
	beq $t0, 112, playA
	j noSound
playA:
	li $a0, 57		# $a0 = 57, play A
	j noteEnd
playAshort:
	li $a0, 57		# $a0 = 57, play A
	li $a1, 200		# $a1 = 200, play for 200 ms
	j noteEnd
playB:
	li $a0, 59		# $a0 = 59, play B
	j noteEnd
playBshort:
	li $a0, 59		# $a0 = 59, play B
	li $a1, 200		# $a1 = 200, play for 200 ms
	j noteEnd
playC:
	li $a0, 60		# $a0 = 60, play C
	j noteEnd
playCshort:
	li $a0, 60		# $a0 = 60, play C
	li $a1, 200		# $a1 = 200, play for 200 ms
	j noteEnd
playD:
	li $a0, 62		# $a0 = 62, play D
	j noteEnd
playDshort:
	li $a0, 62		# $a0 = 62, play D
	li $a1, 200		# $a1 = 200, play for 200 ms
	j noteEnd
playE:
	li $a0, 64		# $a0 = 64, play E
	j noteEnd

noteEnd:
	li $v0, 31		# $v0 = 31, system call for play MIDI sound
	li $a2, 37		# $a2 = 37, instrument = slap bass
	li $a3, 64		# $a3 = 64, half volume
	syscall
noSound:
	addi $t0, $t0, 1	# $t0 += 1, increment $t0
	li $t1, 128		# $t1 = 128
	div $t0, $t1		# $t0 / $t1
	mfhi $t0		# $t0 = $t0 mod 128
	sw $t0, curSound	# save $t0 as current sound
	# done background music

	# erase entites
	# erase doodle
	lw $a0, doodleCol
	lw $a1, doodleRow
	addi $a1, $a1, -7	# $a1 += -7, adjust because doodle's position stored at bottom left
	lw $a2, doodleWidth
	lw $a3, doodleHeight
	jal eraseRectangle
	# erase score
	li $a0, 25
	li $a1, 2
	li $a2, 19
	li $a3, 7
	jal eraseRectangle
	# erase platforms
	la $s0, platformPos	# $s0 = platform position base address
	li $s1, 11		# $s1 = 11, counts down number of platforms still to erase
erasePlatformLoop:		# loop for erasing platforms
	lw $a0, 0($s0)		# $a0 = column of platform
	addi $s0, $s0, 4	# $s0 += 4, increment $s0 by 1 word
	lw $a1, 0($s0)		# $a1 = row of platform
	addi $s0, $s0, 4	# $s0 += 4, increment $s0 by 1 word
	li $a2, 16
	li $a3, 4
	jal eraseRectangle	# jump to erase rectangle
	addi $s1, $s1, -1	# $t2 += -1, decrement counter
	bgtz $s1, erasePlatformLoop	# keep looping if counter still greater than 0
	# done erasing platforms
	
	
	# update hSpeed based on keyboard input
	lw $t0, 0xffff0000		# $t0 = is key being pressed?
	beq $t0, 1, calculateHSpeed	# branch to intrepret keyboard input if key is pressed
	li $s0, 0			# otherwise set horizontal speed to 0
	j calculateHSpeedDone		# jump to done calculating

calculateHSpeed:
	lw $t0, 0xffff0004		# $t0 = ASCII value of key being pressed
	beq $t0, 0x6a, moveLeft		# if key being pressed is J, jump to moveLeft
	beq $t0, 0x6b, moveRight	# if key being pressed is K, jump to moveRight
	li $s0, 0			# otherwise set horizontal speed to 0
	j calculateHSpeedDone		# jump to done calculating

moveLeft:				# if doodle should move left
	li $s0, -4			# $s0 = -4, 4 units to the left
	j calculateHSpeedDone		# jump to done calculating
	
moveRight:				# if doodle should move right
	li $s0, 4			# $s0 = 4, 4 units to the right
	# j calculateHpeedDone		# jump to done calculating

calculateHSpeedDone:			# done calcualting horizontal speed
	# update doodle's horizontal position
	lw $t0, doodleCol	# $t0 = doodle's old column
	add $t0, $t0, $s0	# update doodle's column
	# adjust doodle's column if out of bounds left or right
	blt $t0, 0, adjustColLeft
	bgt $t0, 56, adjustColRight
	j adjustColDone
adjustColLeft:
	li $t0, 0
	j adjustColDone
adjustColRight:
	li $t0, 56
	# j adjustColDone
adjustColDone:
	# done adjusting $
	sw $t0, doodleCol	# save doodle's column

	
	# check collision between doodle and platforms
	# if doodle collides with platform, set airTime = 0
	# snap doodle to platform if it would travel past it downwards
	# acceleration = -0.5 pixels / frame^2
	lw $t0, airTime		# $t0 = air time
	sra $s4, $t0, 1		# divide air time by 2
	addi $s4, $s4, -6	# subtract 6, $s4 = vertical speed
	addi $t0, $t0, 1	# increment $t0
	sw $t0, airTime		# save incremented air time
	# li $v0, 1
    	# move $a0, $s4
    	# syscall
    	# li $v0, 32
	# li $a0, 500		# sleep for 40 ms
	# syscall
	
	bltz $s4, noCollision	# if travelling up, don't check for collision
	# check for collision
	lw $s0, doodleCol	# $s0 = doodle's column, leftmost column of doodle's collision box
	addi $s2, $s0, 8	# $s2 = $s0 + 8, rightmost column of doodle's collision box
	lw $s1, doodleRow	# $s1 = doodle's row
	addi $s1, $s1, 1	# $s1 += 1, topmost row of doodle's collision box
	add $s3, $s1, $s4	# $s3 = $s1 + $s4, bottommost row of doodle's collision box
	
	la $t9, platformPos	# $t9 = platform position base address
	li $t8, 11		# $t8 = 11, counts down number of platforms to check
collisionLoop:		# check if collision box coincides with platform top
	lw $t0, 0($t9)		# $t0 = leftmost column of platform's collision box
	addi $t9, $t9, 4	# $t9 += 4, increment $t9 by 1 word
	lw $t1, 0($t9)		# $t1 = row of platform
	addi $t9, $t9, 4	# $t9 += 4, increment $t9 by 1 word
	addi $t2, $t0, 16	# $t2 = $t0 + 16, rightmost column of platform's collision box
	
	# using inequalities to check for collision
	blt $t2, $s0, collisionNone	# if platform to the left of doodle, no collision
	bgt $t0, $s2, collisionNone	# if platform to the right of doodle, no collision
	blt $t1, $s1, collisionNone	# if platform is above doodle, no collision
	bgt $t1, $s3, collisionNone	# if platform is below doodle, no collision
	
	# a collision occured
	addi $t3, $t1, -1	# $t1 = $t2 - 1, doodle's new row
	sw $t3, doodleRow	# save doodle's row
	sw $zero, airTime	# set air time = 0
	# play bounce sound
	li $v0, 31		# $v0 = 31, play MID sound
	li $a0, 84		# $a0 = 84, play high D
	li $a1, 100		# $a1 = 100, play sound for 100 ms
	li $a2, 116		# $a2 = 116, intrument = woodblock
	li $a3, 128		# $a3 = 128, max volume
	syscall
	# done playing bounce sound
	j vSpeedDone
	
collisionNone:			# no collision for this platform
	addi $t8, $t8, -1	# $t8 += -1, decrement counter
	bgtz $t8, collisionLoop	# keep looping if counter still greater than 0
	# done drawing platforms
	
noCollision:			# no collisions
	# update doodle's vertical position according to its vertical speed
	lw $t3, doodleRow	# $t3 = doodle's old row
	add $t3, $t3, $s4	# $t3 += $t4, update doodle's row
	sw $t3, doodleRow	# save doodle's row
	lw $t0, curScore	# $t0 = current score
	li $t1, 112		# $t1 = 112, doodle's starting row
	sub $t1, $t1, $t3	# $t1 -= $t3, score if just starting
	bge $t0, $t1, scoreDoneUpdate1	# if current score >= 112 - doodle's row, don't update score
	addi $t0, $t1, 0	# $t0 = $t1, else set current score = 112 - doodle's row
scoreDoneUpdate1:		# done updating score (without accounting for screen scroll)
	sw $t0, curScore	# save score to curScore
	
vSpeedDone:

	# SCREEN SCROLLING YIKES
	lw $t0, doodleRow	# $t0 = doodle's row
	bge $t0, 64, scrollDone	# if doodle in bottom half of screen, don't scroll
	li $s7, 64		# $s7 = 64
	sub $s7, $s7, $t0	# $s7 = 64 - doodle's row, amount to scroll
	# update score based on amount of screen scroll
	lw $t1, curScore	# $t1 = current score
	add $t1, $t1, $s7	# $t1 += $s7, increment score by amount to scroll
	sw $t1, curScore	# save $t1 to curScore
	
	# li $v0, 1
    	# move $a0, $s7
    	# syscall
	
	add $t0, $t0, $s7	# $t0 += $s7, increment doodle's row by amount to scroll
	sw $t0, doodleRow	# save doodle's row
	
	# li $v0, 32
	# li $a0, 500
	# syscall		# sleep
	
	# scroll the platforms
	la $s0, platformPos	# $s0 = platform position base address
	li $s1, 11		# $s1 = 11, counts down number of platforms still to scroll
scrollPlatformLoop:		# scroll the platforms down
	lw $t0, 0($s0)		# $t0 = column of platform
	addi $s0, $s0, 4	# $s0 += 4, increment $s0 by 1 word
	lw $t1, 0($s0)		# $t1 = row of platform
	addi $s0, $s0, -4	# $s0 -= 4, decrement $s0 by 1 word
	add $t1, $t1, $s7	# $t1 += $s7, increment platform's row by amount to scroll
	ble $t1, 127, updateNone	# if platform above bottom screen border, don't change its row
	# generate a new platform
	li $v0, 42		# id for random number generator
	li $a0, 0		# id of random number generator = 0
	li $a1, 49		# upper bound of random integer
	syscall			# get random number between 0 and 48
	addi $t0, $a0, 0	# $t0 = random number
	addi $t1, $t1, -132	# $t1 += -132, move platform above screen	
updateNone:
	sw $t0, 0($s0)		# save new column number of platform
	addi $s0, $s0, 4	# $s0 += 4, increment $s0 by 1 word
	sw $t1, 0($s0)		# save new row number of platform
	addi $s0, $s0, 4	# $s0 += 4, increment $s0 by 1 word
	addi $s1, $s1, -1	# $s1 += -1, decrement counter
	bgtz $s1, scrollPlatformLoop	# keep looping if counter still greater than 0
	# done scrolling platforms

scrollDone:			# done scrolling
	# draw new score
	li $a0, 25
	li $a1, 2
	lw $a2, curScore
	jal drawNumber		# draw new score
	
	# draw the platforms
	la $s0, platformPos	# $s0 = platform position base address
	li $s1, 11		# $s1 = 11, counts down number of platforms still to draw
drawPlatformLoop:		# draw the platforms
	lw $a0, 0($s0)		# $a0 = column of platform
	addi $s0, $s0, 4	# $s0 += 4, increment $s0 by 1 word
	lw $a1, 0($s0)		# $a1 = row of platform
	addi $s0, $s0, 4	# $s0 += 4, increment $s0 by 1 word
	jal drawPlatform	# jump to draw platform
	addi $s1, $s1, -1	# $s1 += -1, decrement counter
	bgtz $s1, drawPlatformLoop	# keep looping if counter still greater than 0
	# done drawing platforms

	# draw new doodle
	lw $a0, doodleCol	# $a0 = doodle's column
	lw $a1, doodleRow	# $a1 = doodle's row
	jal drawDoodle		# draw Doodle
	
	li $v0, 32
	li $a0, 40		# sleep for 40 ms
	syscall
	lw $t0, doodleRow	# $t0 = doodle's row
	ble $t0, 127, gameLoop	# loop if row less than height
	
	
endScreen:			# game over screen
	li $v0, 32		# $v0 = 32, system call for sleep
	li $a0, 100		# $a0 = 100, sleep for 100 ms
	syscall
	# play game over music
	# set up intrument
	li $v0, 33		# $v0 = 33, system call for MIDI with sleep
	li $a1, 300		# $a1 = 300, play sound for 300 ms
	li $a2, 37		# $a2 = 37, instrument = slap bass
	li $a3, 128		# $a3 = 128, max volume
	
	li $a0, 66		# $a0 = 66, play F sharp
	syscall
	li $a0, 65		# $a0 = 65, play F
	syscall
	li $a0, 64		# $a0 = 64, play E
	syscall
	li $a0, 63		# $a0 = 63, play D sharp
	li $a1, 1000		# $a1 = 1000, play sound for 1000 ms
	syscall
	# done game over music

	li $t0, 1		# $t0 = 1
	sw $t0, gameState	# set game state to 1, game over
	jal setBackground	# draw the background
	jal drawBackground	# draw the background
	lw $a2, curScore	# $a2 = current score
	li $a0, 34		# $a0 = 40, column to start drawing
	li $a1, 82		# $a1 = 82, row to start drawing
	jal drawNumber		# draw the current score to the screen
endKeyLoop:
	lw $t0, 0xffff0000		# $t0 = is key being pressed?
	beq $t0, 1, endKeyInput		# branch to intrepret keyboard input if key is pressed
	j endKeyLoop			# otherwise repeat loop

endKeyInput:			
	lw $t0, 0xffff0004		# $t0 = ASCII value of key being pressed
	beq $t0, 0x73, welcomeScreen	# if key being pressed is S, return to welcome screen
	beq $t0, 0x65, exit		# if key being pressed is E, exit
	j endKeyLoop			# otherwise, jump back to welcomeKeyLoop


exit:
	li $v0, 10 		# terminate the program gracefully
	syscall





setBackground:			# set the background according to a preset
	lw $t9, gameState	# $t9 = game state
	bltz $t9, getWelcome	# if game state = -1, set welcome
	blez $t9, getGame	# if game state = 0, set in-game
	# if game state = 1, set game over
	la $t0, gameOverBackgroundPreset	# $t0 = base address of background preset
	j endGetPreset
getWelcome:
	la $t0, welcomeBackgroundPreset		# $t0 = base address of background preset
	j endGetPreset
getGame:
	la $t0, gameBackgroundPreset		# $t0, base address of background preset
endGetPreset:
	la $t1, background	# $t1 = base address of background
	li $t2, 0		# $t2 = 0 = current index
	lw $t3, displayHeight 	# $t3 = display height
	mul $t3, $t3, 64	# $t3 = height * width
	sll $t3, $t3, 2		# $t3 *= 4, stores value for $t2 to stop at
setBackgroundWhile:
	add $t4, $t0, $t2	# $t4 = address from preset to load from
	add $t5, $t1, $t2	# $t5 = address from background to write to
	lw $t6, 0($t4)		# $t6 = color loaded from preset
	sw $t6, 0($t5)		# set color to background
	addi $t2, $t2, 4	# increment index by 1 word
	bne $t2, $t3, setBackgroundWhile	# loop if max index not yet reached
	jr $ra			# return

	
drawBackgroundPixel:		# draw background pixel color at column $a0 and row $a1
				# base address of background = $a2, base address of display = $a3
				# used when initially drawing the background, or when clearing an object
	add $t0, $a2, $zero	# $t0 = base address of background
	add $t1, $a3, $zero 	# $t1 = base address of display
	mul $t2, $a1, 64	# $t2 = row * width
	add $t2, $t2, $a0	# $t2 += column
	sll $t2, $t2, 2		# $t2 &*= 4, to get index
	add $t0, $t0, $t2	# $t0 += index, address of background pixel color
	add $t1, $t1, $t2	# $t1 += index, address in display to color
	lw $t3, 0($t0)		# retrieve the background color
	sw $t3, 0($t1)		# color the display with the background color
	jr $ra			# return

		
drawPixel:			# draw a pixel at column $a0 and row $a1
				# base address of buffer = $a2, color to draw = $a3
				# used to draw objects to the screen
	add $t0, $a2, $zero 	# $t0 = base address of display
	mul $t1, $a1, 64	# $t1 = row * width
	add $t1, $t1, $a0	# $t1 += column
	sll $t1, $t1, 2		# $t1 &*= 4, to get index in display
	add $t0, $t0, $t1	# $t0 += index, to get address to write to
	sw $a3, 0($t0)		# paint the pixel to the specifed color
	jr $ra			# return


drawBackground:			# draw the background
	addi $sp, $sp, -4 	# move stack pointer up
	sw $ra, 0($sp) 		# push $ra to stack
	li $a0, 0		# $a0 = 0 stores current column
	li $a1, 0		# $a1 = 0 stores current row
	la $a2, background	# $a2 = base address of background
	lw $a3, displayAddress 	# $a3 = base address of display
drawBackgroundLoop:		# draw a pixel of the background
	jal drawBackgroundPixel
	lw $t9, displayHeight 	# $t9 = display height
	addi $a0, $a0, 1	# increment column
	bne $a0, 64, drawBackgroundLoop	# if column not overflow, jump back and draw another pixel
	li $a0, 0		# if column overflowed, reset current column
	addi $a1, $a1, 1	# increment row
	bne $a1, $t9, drawBackgroundLoop	# if row not overflow, jump back and draw another pixel
	# done drawing background
	lw $ra, 0($sp)		# pop $ra froms stack
	addi $sp, $sp, 4	# move stack pointer down
	jr $ra			# return to main loop
	

drawDoodle:			# draw Doodle at ($a0, $a1)
	addi $sp, $sp, -4 	# move stack pointer up
	sw $ra, 0($sp) 		# push $ra to stack
	addi $sp, $sp, -4 	# move stack pointer up
	sw $s0, 0($sp) 		# push $s0 to stack
	addi $sp, $sp, -4 	# move stack pointer up
	sw $s1, 0($sp) 		# push $s1 to stack
	addi $sp, $sp, -4 	# move stack pointer up
	sw $s2, 0($sp) 		# push $s2 to stack
	add $s0, $a0, $zero	# $s0 stores the leftmost column number
	add $s1, $a1, $zero	# $s1 stores the bottommost row number
	lw $a2, displayAddress 	# $a2 = base address of display
	lw $a3, doodleOutline	# $a3 stores Doodle's color
	addi $a0, $s0, 0	# $a0 = column
	addi $a1, $s1, 0	# $a1 = row
	jal drawPixel
	addi $a0, $s0, 1
	jal drawPixel
	addi $a0, $s0, 3
	jal drawPixel
	addi $a0, $s0, 4
	jal drawPixel
	addi $a0, $s0, 6
	jal drawPixel
	addi $a0, $s0, 7
	jal drawPixel
	# done drawing 0th row
	addi $a0, $s0, 1
	addi $a1, $s1, -1
	jal drawPixel
	addi $a0, $s0, 4
	jal drawPixel
	addi $a0, $s0, 7
	jal drawPixel
	# done drawing 1st row
	addi $s2, $s0, 8	# index for end of row
	addi $a0, $s0, 0
	addi $a1, $s1, -2
drawDoodle2:
	jal drawPixel
	addi $a0, $a0, 1
	bne $a0, $s2, drawDoodle2
	# done drawing 2nd row
	addi $a0, $s0, 0
	addi $a1, $s1, -3
	jal drawPixel
	addi $a0, $s0, 7
	jal drawPixel
	# done drawing 3rd row
	addi $a0, $s0, 0
	addi $a1, $s1, -4
drawDoodle4:
	jal drawPixel
