	addi $a0, $s0, 3
	jal drawPixel
	addi $a0, $s0, 4
	jal drawPixel
	addi $a0, $s0, 5
	jal drawPixel
	# done drawing 7th row
	# start drawing body
	addi $s2, $s0, 7	# index for 1 from end of row
	addi $a0, $s0, 1
	addi $a1, $s1, -3
	lw $a3, doodleBody
drawDoodleBody:
	jal drawPixel
	addi $a0, $a0, 1
	bne $a0, $s2, drawDoodleBody
	# done drawing body
	# start drawing head
	addi $s2, $s0, 6	# index for 2 from end of row
	addi $a0, $s0, 2
	addi $a1, $s1, -5
	lw $a3, doodleHead
drawDoodleHead1:
	jal drawPixel
	addi $a0, $a0, 1
	bne $a0, $s2, drawDoodleHead1
	# done bottom row of head
