drawDoodleHead2:
	jal drawPixel
	addi $a0, $a0, 1
	bne $a0, $s2, drawDoodleHead2
	# done drawing Doodle
	lw $s2, 0($sp)		# pop $s2 from stack
	addi $sp, $sp, 4	# move stack pointer down
	lw $s1, 0($sp)		# pop $s1 from stack
	addi $sp, $sp, 4	# move stack pointer down
	lw $s0, 0($sp)		# pop $s0 from stack
	addi $sp, $sp, 4	# move stack pointer down
	lw $ra, 0($sp)		# pop $ra from stack
	addi $sp, $sp, 4	# move stack pointer down
	jr $ra			# return to main loop


drawPlatform:			# draw a platform with it's top-left corner at ($a0, $a1)
	addi $sp, $sp, -4 	# move stack pointer up
	sw $ra, 0($sp) 		# push $ra to stack
	addi $sp, $sp, -4 	# move stack pointer up
	sw $s0, 0($sp) 		# push $s0 to stack
	addi $sp, $sp, -4 	# move stack pointer up
	sw $s1, 0($sp) 		# push $s1 to stack
	addi $sp, $sp, -4 	# move stack pointer up
	sw $s2, 0($sp) 		# push $s2 to stack
	add $s0, $a0, $zero	# $s0 = the leftmost column number
	add $s1, $a1, $zero	# $s1 = the topmost row number
	lw $a2, displayAddress 	# $a2 = base address of display
	lw $a3, platformOutline	# $a3 = platform outline color
	ble $s1, -4, drawPlatformEnd	# if row <= -4, don't draw anything
	ble $s1, -3, drawPlatform4	# if row <= -3, only draw starting from last row
	ble $s1, -2, drawPlatform3	# if row <= -2, only draw starting from third row
	ble $s1, -1, drawPlatform2	# if row <= -1, only draw starting from second row
drawPlatform1:			# start drawing top row
	addi $s2, $s0, 16	# index for end of row
	addi $a0, $s0, 0
	addi $a1, $s1, 0
drawPlatformTop:
	jal drawPixel
	addi $a0, $a0, 1
	bne $a0, $s2, drawPlatformTop
	# done top row
	bge $s1, 127, drawPlatformEnd	# if row >= 127, don't draw more than first row
drawPlatform2:			# start drawing second row
	# draw sides
	addi $a0, $s0, 0
	addi $a1, $s1, 1
	jal drawPixel
	addi $a0, $s0, 15
	jal drawPixel
	# done drawing sides
	# draw upper body
	lw $a3, platformBody	# $a3 = platform body color
	addi $s2, $s0, 15	# index for 1 from end of row
	addi $a0, $s0, 1
	addi $a1, $s1, 1
drawPlatformUpper:
	jal drawPixel
	addi $a0, $a0, 1
	bne $a0, $s2, drawPlatformUpper
	# done upper row of body
	lw $a3, platformOutline	# $a3 = platform outline color
	# done drawing second row
	bge $s1, 126, drawPlatformEnd	# if row >= 126, don't draw more than second row
drawPlatform3: 			# start drawing third row
	# draw sides
	addi $a0, $s0, 1
	addi $a1, $s1, 2
	jal drawPixel
	addi $a0, $s0, 14
	jal drawPixel
	# done drawing sides
	# draw lower body
	lw $a3, platformBody	# $a3 = platform body color
	addi $s2, $s0, 14	# index for 2 from end of row
	addi $a0, $s0, 2
	addi $a1, $s1, 2
drawPlatformLower:
	jal drawPixel
	addi $a0, $a0, 1
	bne $a0, $s2, drawPlatformLower
	# done lower row of body
	lw $a3, platformOutline	# $a3 = platform outline color
	# done third row
	bge $s1, 125, drawPlatformEnd	# if row >= 125, don't draw more than third row
drawPlatform4:			# start drawing bottom row
	addi $s2, $s0, 14	# index for 2 from end of row
	addi $a0, $s0, 2
	addi $a1, $s1, 3
drawPlatformBottom:
	jal drawPixel
	addi $a0, $a0, 1
	bne $a0, $s2, drawPlatformBottom
	# done bottom row
	# done drawing platform
drawPlatformEnd:
	lw $s2, 0($sp)		# pop $s2 from stack
	addi $sp, $sp, 4	# move stack pointer down
	lw $s1, 0($sp)		# pop $s1 from stack
	addi $sp, $sp, 4	# move stack pointer down
	lw $s0, 0($sp)		# pop $s0 from stack
	addi $sp, $sp, 4	# move stack pointer down
	lw $ra, 0($sp)		# pop $ra from stack
	addi $sp, $sp, 4	# move stack pointer down
	jr $ra		# return to main loop


eraseRectangle:			# erase rectangle at ($a0, $a1) with width $a2 and height $a3
	addi $sp, $sp, -4 	# move stack pointer up
	sw $ra, 0($sp) 		# push $ra to stack
	addi $sp, $sp, -4 	# move stack pointer up
	sw $s0, 0($sp) 		# push $s0 to stack
	addi $sp, $sp, -4 	# move stack pointer up
	sw $s1, 0($sp) 		# push $s1 to stack
	addi $sp, $sp, -4 	# move stack pointer up
	sw $s2, 0($sp) 		# push $s2 to stack
	addi $sp, $sp, -4 	# move stack pointer up
	sw $s3, 0($sp) 		# push $s3 to stack
	add $s0, $a0, $zero	# $s0 = the leftmost column number
	add $s1, $a1, $zero	# $s1 = the topmmost row number
	add $s2, $a2, $zero	# $s2 = rectangle width
	add $s3, $a3, $zero	# $s3 = rectangle height
	add $s2, $s0, $s2	# $s2 = rightmost column number + 1 (stopping index)
	add $s3, $s1, $s3	# $s3 = bottom row number + 1 (stopping index)
	
	# adjut bounds to not erase out of bounds
	# adjust $s1
	blt $s1, 0, adjusts1Top
	bgt $s1, 127, adjusts1Bottom
	j adjusts1Done
adjusts1Top:
	li $s1, 0
	j adjusts1Done
adjusts1Bottom:
	li $s1, 128
	# j adjusts1Done
adjusts1Done:
	# done adjusting $s1
	# adjust $s3
	blt $s3, 0, adjusts3Top
	bgt $s3, 127, adjusts3Bottom
	j adjusts3Done
adjusts3Top:
	li $s3, 0
	j adjusts3Done
adjusts3Bottom:
	li $s3, 128
	# j adjusts3Done
adjusts3Done:
	# done adjusting $s3
	add $a0, $s0, $zero	# $a0 = current column
	add $a1, $s1, $zero	# $a1 = current row
	la $a2, background	# $a2 = base address of background
	lw $a3, displayAddress 	# $a3 = base address of display
	
	beq $a1, $s3, eraseRectangleDone	# if $a1 = $s3, nothing to draw
eraseRectangleLoop:
	jal drawBackgroundPixel
	addi $a0, $a0, 1	# increment column
	bne $a0, $s2, eraseRectangleLoop	# if column not overflow, jump back and draw another pixel
	add $a0, $s0, $zero	# if column overflowed, reset current column
	addi $a1, $a1, 1	# increment row
	bne $a1, $s3, eraseRectangleLoop	# if row not overflow, jump back and draw another pixel
eraseRectangleDone:		# done erasing rectangle
	lw $s3, 0($sp)		# pop $s3 from stack
	addi $sp, $sp, 4	# move stack pointer down
	lw $s2, 0($sp)		# pop $s2 from stack
	addi $sp, $sp, 4	# move stack pointer down
	lw $s1, 0($sp)		# pop $s1 from stack
	addi $sp, $sp, 4	# move stack pointer down
	lw $s0, 0($sp)		# pop $s0 from stack
	addi $sp, $sp, 4	# move stack pointer down
	lw $ra, 0($sp)		# pop $ra from stack
	addi $sp, $sp, 4	# move stack pointer down
	jr $ra			# return to main loop


drawNumber:			# draw the number $a2 at position ($a0, $a1)
				# maximum 5 digits
	addi $sp, $sp, -4 	# move stack pointer up
	sw $ra, 0($sp) 		# push $ra to stack
	addi $sp, $sp, -4 	# move stack pointer up
	sw $s0, 0($sp) 		# push $s0 to stack
	addi $sp, $sp, -4 	# move stack pointer up
	sw $s1, 0($sp) 		# push $s1 to stack
	addi $sp, $sp, -4 	# move stack pointer up
	sw $s2, 0($sp) 		# push $s2 to stack
	addi $sp, $sp, -4 	# move stack pointer up
	sw $s3, 0($sp) 		# push $s3 to stack

	add $s0, $a2, $zero	# $s0 = $a2 = number to draw
	addi $s1, $zero, 10	# $s1 = 10
	add $s2, $a0, $zero	# $s2 = column to draw number
	add $s3, $a1, $zero	# $s3 = row to draw number (UNCHANGING)
	addi $s2, $s2, 16	# $s0 += 16 (draw one's digit first)
drawNumberLoop:
	div $s0, $s1		# $s0 / $s1
	mfhi $a2		# $a2 = remainder of $s0 / $s1, digit to draw
	mflo $s0		# $s0 = quotient of $s0 / $s1
	add $a0, $s2, $zero	# $a0 = column to draw digit
	add $a1, $s3, $zero	# $a1 = row to draw digit
	jal drawDigit		# draw digit $a2 at position ($a0, $a1)
	addi $s2, $s2, -4	# $s2 += -4, decrement column by one number
	bgtz $s0, drawNumberLoop	# keep drawing if quotient is nonzero
	# done drawing number
	
	lw $s3, 0($sp)		# pop $s3 from stack
	addi $sp, $sp, 4	# move stack pointer down
	lw $s2, 0($sp)		# pop $s2 from stack
	addi $sp, $sp, 4	# move stack pointer down
	lw $s1, 0($sp)		# pop $s1 from stack
	addi $sp, $sp, 4	# move stack pointer down
	lw $s0, 0($sp)		# pop $s0 from stack
	addi $sp, $sp, 4	# move stack pointer down
	lw $ra, 0($sp)		# pop $ra froms stack
	addi $sp, $sp, 4	# move stack pointer down
	jr $ra			# return to main loop


drawDigit:			# draw the digit $a2 at position ($a0, $a1)
	addi $sp, $sp, -4 	# move stack pointer up
	sw $ra, 0($sp) 		# push $ra to stack
	addi $sp, $sp, -4 	# move stack pointer up
	sw $s0, 0($sp) 		# push $s0 to stack
	addi $sp, $sp, -4 	# move stack pointer up
	sw $s1, 0($sp) 		# push $s1 to stack
	addi $sp, $sp, -4 	# move stack pointer up
	sw $s2, 0($sp) 		# push $s2 to stack
	
	add $s0, $a0, $zero	# $s0 = leftmost column number
	add $s1, $a1, $zero	# $s1 = topmost row number
	add $s2, $a2, $zero	# $s2 = digit to display
	lw $a2, displayAddress 	# $a2 = base address of display
	lw $a3, numberColor	# $a3 = color of number
	
	addi $t0, $zero, 0	# $t0 = 0
	beq $s2, $t0, drawZero	# draw 0
	addi $t0, $zero, 1	# $t0 = 1
	beq $s2, $t0, drawOne	# draw 1
	addi $t0, $zero, 2	# $t0 = 2
	beq $s2, $t0, drawTwo	# draw 2
	addi $t0, $zero, 3	# $t0 = 3
	beq $s2, $t0, drawThree	# draw 3
	addi $t0, $zero, 4	# $t0 = 4
	beq $s2, $t0, drawFour	# draw 4
	addi $t0, $zero, 5	# $t0 = 5
	beq $s2, $t0, drawFive	# draw 5
	addi $t0, $zero, 6	# $t0 = 6
	beq $s2, $t0, drawSix	# draw 6
	addi $t0, $zero, 7	# $t0 = 7
	beq $s2, $t0, drawSeven	# draw 7
	addi $t0, $zero, 8	# $t0 = 8
	beq $s2, $t0, drawEight	# draw 8
	# addi $t0, $zero, 9	# $t0 = 9
	# beq $s2, $t0, drawNine	# draw 9
	j drawNine
	
